def registerLabels():
    """
    This function search for labels / subprogram-labels and registers this in the 'jumps' list.
    """
    for i in range(len(tokens)):
        if tokens[i].t == "label":
            jumps[tokens[i].token] = i
        elif tokens[i].t == "subprogram":
            jumps[tokens[i].token] = i
